pragma solidity ^0.5.0;

contract reg_renewal {

    //accounts = msg.sender;
    
    address payable public addrs = 0xe77025E470B5947df14AD76614DC8DE1232f2CB1 ;
    int[5] public vin = [12, 34,56,78];
    int[5] public title = [87,65,43,21];
    string[5] public addr = ["1049 W, 49th street", "1055 48th street", "1064 48th street", "1011  42th street"];
    string[5] public names = ["vamsi", "krishna", "sonisha", "kothineni", "sonu"];
    int[5] public lic_num = [1,2,3,4,5];
    string[5] public date = ["2019-01-03","2019-03-17","2020-10-21","2021-05-25","2022-07-27"];
    string[5] public vechicles = ["I20","I10","Jeep","Dodge","Mustang"];
    int[5] public vech_own = [2,3,5,1,3];
    uint256 private deposit;

    function getdetails(int _vin) view public returns(string memory , string memory, string memory ) {
        for(uint i =0; i<5; i++)
        {
            if (_vin == vin[i])
            {return (addr[i], names[i], date[i]);}
        }
    }

    function transfer_ether( uint currency) payable public returns(uint256 ) {
        deposit = currency;
        
        addrs.transfer(deposit);

        return deposit ;
    }
    
    function set_renewal_date( string memory _date, int _vin) public returns(string  memory)
    {
        for (uint i=0;i<5;i++)
        {
            if(_vin == vin[i])
            {
                date[i] = _date;
            }
        }
        return "set the renewal date succesufully";
    }

    function set_address( string memory _address, int _vin) public returns(string  memory)
    {
        for (uint i=0;i<5;i++)
        {
            if(_vin == vin[i])
            {
                addr[i] = _address;
            }
        }
        return "set the address succesufully";
    }
   
}
